                        <h1>{dado.cpf}</h1>
                        <h1>{dado.email}</h1>
                        <h1 className="nivelAcesso">{dado.nivelAcesso}</h1>
                    
                        <button value={id} 
                        onClick={function(event){
                            func1();
                            func2();
                         }}
                        >Ativar</button>
                        <button onClick={desativar}>Desativar</button>
                    
                    </li>
                    ))
                    }
            </ul>
    </div>
    );
}
